import React from "react";
import Simpson from "./Simpson";

function Simpsons(data, favourited) {
  console.log(data, "HI");
  const {} = data;
  return data.map((item, id) => {
    return <Simpson key={id} id={id} item={item} favourited={favourited} />;
  });
}

export default Simpsons;
